import React from 'react';

const FProgressBar = ({ progress }) => {
  const progressBarStyle = {
    background: '#fff',
    height: '2px',
    position: 'relative',
    width: '100%',
  };

  const progressStyle = {
    background: '#00bfff',
    height: '4px',
    left: 0,
    position: 'absolute',
    transition: 'width 0.3s ease-in-out',
    width: `${progress}%`,
  };

  return (
    <div style={progressBarStyle}>
      <div style={progressStyle} />
    </div>
  );
};

export default FProgressBar;
